import React, { useEffect, useState } from "react";
import { FCheckbox, FormProvider, FTextField } from "../components/form";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import * as Yup from "yup";
import GoogleIcon from '@mui/icons-material/Google';
import FacebookIcon from '@mui/icons-material/Facebook';
import { useLocation, useNavigate, Link as RouterLink } from "react-router-dom";
import { Container } from "@mui/system";
import { LoadingButton } from "@mui/lab";
import { Alert, Box, Button, Card, CardContent, Divider, IconButton, InputAdornment, Link, Stack, Typography } from "@mui/material";
import VisibilityIcon from "@mui/icons-material/Visibility";
import VisibilityOffIcon from "@mui/icons-material/VisibilityOff";
import useAuth from "../hooks/useAuth";
import FacebookLogin from "react-facebook-login/dist/facebook-login-render-props";
import { GoogleLogin, GoogleLogout } from "react-google-login";
import { FaFacebookF, FaGoogle } from "react-icons/fa";
import { FACEBOOK_APP_ID } from "../app/config";
import { gapi } from 'gapi-script';

const loginSchema = Yup.object().shape({
  email: Yup.string().email("Invalid email").required("Email is required"),
  password: Yup.string().required("Password is required"),
});

const defaultValues = {
  email: "",
  password: "",
  remember: true,
};
function LoginPage() {
  const [showPassword, setShowPassword] = useState(false);
  const [ profile, setProfile ] = useState([]);
  const auth = useAuth();
  let navigate = useNavigate();
  let location = useLocation();
  const from = location.state?.from?.pathname || "/";
  const clientId = '1083687826911-blkp6q98e53bleiggvuj6omkdf9f178b.apps.googleusercontent.com';
  const methods = useForm({
    resolver: yupResolver(loginSchema),
    defaultValues,
  });
  const {
    handleSubmit,
    reset,
    setError,
    formState: { errors, isSubmiting },
  } = methods;

  const onSubmit = async (data) => {
    
    let { email, password } = data;
  
    try {
      await auth.login({ email, password }, () => {
        navigate(from, { replace: true });
      });
    } catch (error) {
      reset();
      setError("responeError", error);
    }
   
  };

  const loginWithFacebook = async (response) => {
    await auth.loginFacebook(response, () => {
      navigate(from, { replace: true });
    });
  };

   const loginWithGoogle = async (response) => {
    await auth.loginGoogle(response, () => {
      navigate(from, { replace: true });
    });
  };



useEffect(() => {
        const initClient = () => {
            gapi.client.init({
                clientId: clientId,
                scope: ''
            });
        };
        gapi.load('client:auth2', initClient);
    });

    const onSuccess = (res) => {
        setProfile(res.profileObj);
        console.log("res", res.profileObj)
    };

    const onFailure = (err) => {
        console.log('failed', err);
    };

    const logOut = () => {
        setProfile(null);
    };

